import logo from "./logo.svg";
import "./App.css";
import { Provider } from "react-redux";
import store from "./redux/store";
import Table from "./component/table/index";
import Modal from "./component/modal/modal";

function App() {
  return (
    <Provider store={store}>
      <div className="App">
        <Table />
        <Modal open={true}/>
      </div>
    </Provider>
  );
}

export default App;
